# https://leetcode.com/problems/trapping-rain-water/
import time
from typing import List


class Solution:
    def trap(self, height: List[int]) -> int:
        start = time.time()
        m = max(height)
        count = 0
        for i in range(1, m + 1):
            for idx, o in enumerate(height):
                if o >= i:
                    count += idx
                    break
        for i in range(1, m + 1):
            for idx, o in enumerate(height[::-1]):
                if o >= i:
                    count += idx
                    break
        print(time.time() - start)
        return m * len(height) - sum(height) - count





